import { FC, useEffect } from "react";
import "../styles/Trend.scss";
import { Itrends } from "../types/fetchdata";

interface prop {
  data: Itrends[];
}

const Trends: FC<prop> = ({ data }) => {
  return (
    <div>
      <div className='Trends'>
        <div className='first-trend  col-md-4 col-sm-12'>
          <div className='image'>
            <img
              src={`https://image.tmdb.org/t/p/original/${data[1].backdrop_path}`}
              width='100'
            />
          </div>
        </div>
        <div className='All-trends'></div>
      </div>
    </div>
  );
};

export default Trends;
